import React, { useEffect, useState } from 'react';

export default function AchievementsContent() {

    const [achievements, setAchievements] = useState([]);
    const [loading, setLoading] = useState(false);

    useEffect(() => {
        const fetch_achievements = async () => {
            setLoading(true);
            try {
                // AICI PUI FETCH-UL REAL CAND E GATA BACKEND-UL

                // DATE MOCKUP (Fara imagini, folosim culori si iconite CSS)
                const dummyData = [
                    { id: 1, title: 'Daily Chronicler', description: 'Created a note 7 days in a row.', color: 'bg-blue-500', icon: 'ðŸ“…', unlocked: true, date: '2023-12-01' },
                    { id: 2, title: 'Night Owl', description: 'Edited a note between 2 AM and 5 AM.', color: 'bg-indigo-900', icon: 'ðŸ¦‰', unlocked: true, date: '2023-12-05' },
                    { id: 3, title: 'Early Bird', description: 'Created a note before 7 AM.', color: 'bg-orange-400', icon: 'ðŸŒ…', unlocked: false, date: null },
                    { id: 4, title: 'Minimalist', description: 'Created a note with less than 50 words.', color: 'bg-gray-800', icon: 'âš«', unlocked: true, date: '2023-12-10' },
                    { id: 5, title: 'Deep Diver', description: 'Wrote a note with over 2000 words.', color: 'bg-cyan-600', icon: 'ðŸ¤¿', unlocked: false, date: null },
                    { id: 6, title: 'Full Stack', description: 'Used all tag types in a week.', color: 'bg-yellow-500', icon: 'âš¡', unlocked: false, date: null },
                    { id: 7, title: 'Community Leader', description: 'Created a group with 5+ members.', color: 'bg-red-500', icon: 'ðŸ‘‘', unlocked: true, date: '2023-11-20' },
                    { id: 8, title: 'Multimedia Master', description: 'Uploaded 10 images.', color: 'bg-pink-500', icon: 'ðŸ“¸', unlocked: false, date: null },
                    { id: 9, title: 'Marathon Runner', description: 'Studied for 4 hours straight.', color: 'bg-green-600', icon: 'ðŸƒ', unlocked: false, date: null },
                    { id: 10, title: 'Infinity Gauntlet', description: 'Collected all achievements.', color: 'bg-purple-600', icon: 'ðŸ’Ž', unlocked: false, date: null },
                ];

                setTimeout(() => {
                    setAchievements(dummyData);
                    setLoading(false);
                }, 300);

            } catch (err) {
                console.error("Eroare incarcare achievements:", err);
                setLoading(false);
            }
        };

        fetch_achievements();
    }, []);

    return (
        <div className="flex-1 p-6 overflow-auto h-full bg-gray-50">

            {/* Header */}
            <div className="mb-6 border-b pb-4">
                <div className="flex items-center justify-between">
                    <div className="flex items-center gap-3">
                        <div className="bg-yellow-100 p-2 rounded-lg text-yellow-600">
                            <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8v4l3 3m6-3a9 9 0 11-18 0 9 9 0 0118 0z" />
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 3v4M3 5h4M6 17v4m-2-2h4m5-16l2.286 6.857L21 12l-5.714 2.143L13 21l-2.286-6.857L5 12l5.714-2.143L13 3z" />
                            </svg>
                        </div>
                        <div>
                            <h2 className="text-2xl font-bold text-gray-800">Achievements</h2>
                            <p className="text-sm text-gray-500">Track your progress and badges</p>
                        </div>
                    </div>

                    <div className="flex gap-3">
                         <div className="px-4 py-2 rounded-lg bg-white border text-sm text-gray-600 font-medium shadow-sm">
                            {achievements.filter(a => a.unlocked).length} / {achievements.length} Unlocked
                        </div>
                    </div>
                </div>
            </div>

            {/* Grid Achievements */}
            {loading ? <p className="text-center text-gray-400 mt-10">Loading badges...</p> : (
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-4">
                    {achievements.map(ach => (
                        <div 
                            key={ach.id} 
                            className={`relative p-4 rounded-xl shadow-sm border transition-all duration-300 hover:shadow-md flex flex-col items-center text-center group ${
                                !ach.unlocked ? 'bg-gray-100 border-gray-200' : 'bg-white border-blue-100'
                            }`}
                        >
                            {/* Cerc Iconita (Inlocuitor de imagine) */}
                            <div className={`w-20 h-20 mb-3 rounded-full flex items-center justify-center text-4xl shadow-sm transition-all duration-500 ${
                                ach.unlocked ? `${ach.color} text-white scale-100` : 'bg-gray-300 text-gray-500 grayscale opacity-50 group-hover:scale-105'
                            }`}>
                                {ach.icon}
                            </div>

                            {/* Titlu si Descriere */}
                            <h4 className={`font-bold text-lg mb-1 ${ach.unlocked ? 'text-gray-800' : 'text-gray-400'}`}>
                                {ach.title}
                            </h4>
                            <p className="text-xs text-gray-500 mb-3 h-8 line-clamp-2 px-2">
                                {ach.description}
                            </p>

                            {/* Footer Status */}
                            <div className="mt-auto w-full pt-3 border-t border-gray-100 flex justify-center">
                                {ach.unlocked ? (
                                    <span className="text-xs font-bold text-green-600 bg-green-50 px-3 py-1 rounded-full border border-green-100 flex items-center gap-1">
                                        <svg className="w-3 h-3" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 13l4 4L19 7" /></svg>
                                        Unlocked: {ach.date}
                                    </span>
                                ) : (
                                    <span className="text-xs font-bold text-gray-400 bg-gray-200 px-3 py-1 rounded-full border border-gray-300 flex items-center gap-1">
                                        <svg className="w-3 h-3" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 15v2m-6 4h12a2 2 0 002-2v-6a2 2 0 00-2-2H6a2 2 0 00-2 2v6a2 2 0 002 2zm10-10V7a4 4 0 00-8 0v4h8z" /></svg>
                                        Locked
                                    </span>
                                )}
                            </div>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
}
